import './card-profile.module.scss'

function CardProfile({ cards }) {
  return (
    <section className="star-list">
      {cards?.length ? (
        <>
          <ul className="star-list__list">
            {cards.map((card) => (
              <li className="star-list__item" key={card.id}>
                <StarCard {...card} />
              </li>
            ))}
          </ul>
        </>
      ) : null}
    </section>
  );
}

export default CardProfile;
